                code: "",
                name: ""
            },
            province: {
                code: "",
                name: ""
            },
            district: {
                code: "",
                name: ""
            },
            township: {
                code: "",
                name: ""
            },
            city: {
                code: "",
                name: ""
            },
            sector: {
                code: "",
                name: ""
            },
            subSector: {
                code: "",
